import { createClient, createMicrophoneAndCameraTracks } from "custom-agora-rtc-react";

const appId = "daf6fb5a57804e71a7c0a94457032eb1";
const token =
  "006bd8eed946c9f4a819945cd4bd2a86aa3IADb7EGlEL4WiP2B4tWGZsyVcDkKllzaaTnfRe3J9/Z3wQx+f0a07aae343c4c7aa2254f0215cb1e93";

export const config = { mode: "rtc", codec: "vp8", appId: appId, token: token };
export const useClient = createClient(config);
export const useMicrophoneAndCameraTracks = createMicrophoneAndCameraTracks();
export const channelName = "test";
